); 注意 ，Deno 命名空间需要一个 ES2018 或更新的运行时环境。这意味着，如果您使用的库“低于” ES2018，那么您将得到编译过程中输出的错误。 使用三斜杠引用（triple-slash reference） 您不必在编译器选项中指定 lib。Deno 支持 对库的三斜杠引用 ，并可以嵌入到文件的内容中。举个例子，如果你有一个 main.ts： /// <reference lib="dom" /> document.getElementById("foo"); 它可以编译，且不会出现下面这样的错误： const [errors, emitted] = await Deno.compile("./main.ts", undefined, { lib: ["esnext"],
